    //Definition for singly-linked list.
    public class ListNode 
    {
        public int val;
        public ListNode next;
        public ListNode(int x) { val = x; }

        public static ListNode SimpleCreate(params int[] vals)
        {
            ListNode dummyHead = new ListNode(0);
            ListNode tail = new ListNode(vals[0]);
            dummyHead.next = tail;

            for(int i = 1; i < vals.Length; i++)
            {
                tail.next = new ListNode(vals[i]);
                tail = tail.next;
            }

            return dummyHead.next;
        }
    }
    
    public class Solution 
    {
        public ListNode MergeKLists(ListNode[] lists) 
        {
            ListNode dummy = new ListNode(0);
            ListNode head = dummy;

            if(lists == null || lists.Length == 0)
                return null;

            MinHeap.MinHeapEle[] minHeapEles = new MinHeap.MinHeapEle[lists.Length];
            for(int i = 0; i < lists.Length; i++)
            {
                minHeapEles[i] = new MinHeap.MinHeapEle(i, lists[i] == null ? Int32.MaxValue : lists[i].val);
            }

            MinHeap minHeap = new MinHeap();
            minHeap.BuildMinHeap(minHeapEles);

            while(true)
            {
                var ele = minHeap.Pop();
                
                if(ele == null)  break;
                
                dummy.next = lists[ele.index];
                dummy = dummy.next;
                lists[ele.index] = lists[ele.index].next;

                ele.val = lists[ele.index] == null ? MinHeap.USELESSVALUE : lists[ele.index].val;
                minHeap.Insert(ele.val, ele.index);
            }

            return head.next;
        }

        public class MinHeap
        {
            private MinHeapEle[] _heap;
            private int _heapCout;
            public static int USELESSVALUE = Int32.MaxValue;

            public class MinHeapEle
            {
                public int index;
                public int val;
                public MinHeapEle(int index, int val) { this.index = index; this.val = val; }
                public static void Swap(MinHeapEle x, MinHeapEle y)
                {
                    int tmp = x.val;
                    x.val = y.val;
                    y.val = tmp;

                    tmp = x.index;
                    x.index = y.index;
                    y.index = tmp;
                }
            }

            public void BuildMinHeap(MinHeapEle[] heapEles)
            {
                _heap = heapEles;
                _heapCout = _heap.Length;

                for(int i = _heapCout / 2; i >= 0; i--)
                {
                    MinHeapify(i);
                }
            }

            public MinHeapEle Pop()
            {
                int lastValidIndex = -1;
                MinHeapEle result = null;

