                    result = new MinHeapEle(_heap[0].index, _heap[0].val);

                    _heap[0].val = USELESSVALUE;
                    MinHeapEle.Swap(_heap[0], _heap[lastValidIndex]);
                    MinHeapify(0);
                }

                return result;
            }

            public void Insert(int val, int index)
            {
                int pos = -1;

                for(int i = _heapCout - 1; i >= 0; i--)
                {
                    if(_heap[i].val != USELESSVALUE)
                    {
                        pos = i + 1;
                        _heap[pos].val = val;
                        _heap[pos].index = index;
                        break;
                    }
                }

                if(pos != -1)
                {
                    if(pos % 2 == 0)
                    {
                        while(pos != 0 && _heap[(pos-1)/2].val > _heap[pos].val)
                        {
                            MinHeapEle.Swap(_heap[(pos-1)/2], _heap[pos]);
                            pos = (pos - 1) / 2;
                        }
                    }
                    else
                    {
                        while(pos != 0 && _heap[pos/2].val > _heap[pos].val)
                        {
                            MinHeapEle.Swap(_heap[pos/2], _heap[pos]);
                            pos = pos / 2;
                        }
                    }
                }
            }

            private void MinHeapify(int i)
            {
                int left, right, minimum;

                while(true)
                {
                    left = 2 * i + 1;
                    right = left + 1;
                    minimum = i;

                    if(left < _heapCout && _heap[left].val < _heap[minimum].val)
                        minimum = left;
                    if(right < _heapCout && _heap[right].val < _heap[minimum].val)
                        minimum = right;
                    
                    if(minimum != i)
                    {
                        MinHeapEle.Swap(_heap[i], _heap[minimum]);
                        i = minimum;
                    }
                    else
                    {
                        break;
                    }
                }
            }
        }        
    }
}